    {   id: 1,
        name: 'Голова',
        duration: 10,
    },
    {   id: 2,
        name: 'Плечи',
        duration: 20,
    },
    {   id: 3,
        name: 'Руки',
        duration: 30,
    },
    {   id: 4,
        name: 'Тело',
        duration: 40,
    },
    {   id: 5,
        name: 'Ноги',
        duration: 50,
    },
    {   id: 6,
        name: 'ШЛЯПА',
        duration: 60,
    },
]

export function VideoList() {
    return (
        <>
            <h1 className="videolist-title">Список Видео:</h1>
            {
                videos.map((video) => {
                    
                    return (
                    
                    <div className="video" key={video.id} data-id={video.id}>
                        <div>{video.name}</div>
                        <div>{video.duration}</div>
                        <button>Like!</button>
                    </div>
                    )
                })
            }
        </>
    )
}
